import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Vehicle Dashboard</h2>
      <nav>
        <ul>
          <li>Dashboard</li>
        </ul>
      </nav>
      <button className="logout-btn">Logout</button>
    </div>
  );
}

export default Sidebar;
